import React, {Component} from 'react';
import styled from 'styled-components';

class Header extends Component{
    render(){
        return(
            <Container>
                <Element>
                    <LogoWrapper>
                        <Logo>
                            Khusinsa
                        </Logo>
                    </LogoWrapper>
                    <HeaderMenu>
                        <Nav>
                            <NavList>
                                <NavItem>상품 검색</NavItem>
                                <NavItem>주문 내역</NavItem>
                                <NavItem>회원 정보</NavItem>
                            </NavList>
                        </Nav>
                        <Sign>
                            <SignItem>회원가입/로그인</SignItem>
                        </Sign>
                    </HeaderMenu>
                </Element>
            </Container>
        )
    }
}


export default Header;


const Container = styled.div`
    width: 100%;
    border-bottom: 1px solid black;
`
const Element = styled.div`
    display: flex;
    margin-left : 10px;
    margin-right : 10px;
`
const LogoWrapper = styled.div`
    width: 20%;
    display: flex;
`
const Logo = styled.div`
    font-size : 20px;
    font-weight: 800;
`
const HeaderMenu = styled.div`
    width: 80%;]
    order: 2;
    display:flex;
`
const Nav = styled.div`
    order: 2;
`
const NavList = styled.ul`
    margin: 0 auto;
    display: flex;
`
const NavItem = styled.li`
    padding-right: 10px;
    padding-left: 10px;
    display: flex;
`
const Sign = styled.div`
    text-align: right;
    width: 150px;
    order:3;
`
const SignItem = styled.div`
`
